import React from 'react';
import styles from './navbar.module.css';
import { NavLink, Router } from 'react-router-dom';

const Navbar = () => {
    return <div className={styles.blockNavbar}>
        <nav>
        <div>
        <NavLink to='/profile'>Main</NavLink>
        </div>
        <div>
        <NavLink to='/posts'>News</NavLink>
        </div>
        <NavLink to='/messages'>Messages</NavLink>
        <NavLink to='/users'>Main</NavLink>
        <NavLink to='/music'>Main</NavLink>
        <NavLink to='/settings'>Main</NavLink>
        </nav>
    </div>
}

export default Navbar;
